import React, { useState,useEffect } from 'react'
import Chart from "react-apexcharts";


var config = {

    series: [67],
            options: {
              chart: {
                height: 350,
                type: 'radialBar',
                offsetY: -10
              },
              plotOptions: {
                radialBar: {
                  startAngle: -135,
                  endAngle: 135,
                  dataLabels: {
                    name: {
                      fontSize: '16px',
                      color: undefined,
                      offsetY: 120
                    },
                    value: {
                      offsetY: 76,
                      fontSize: '22px',
                      color: undefined,
                      formatter: function (val) {
                        return val + "%";
                      }
                    }
                  }
                }
              },
              fill: {
                type: 'gradient',
                gradient: {
                    shade: 'dark',
                    shadeIntensity: 0.15,
                    inverseColors: false,
                    opacityFrom: 1,
                    opacityTo: 1,
                    stops: [0, 50, 65, 91]
                },
              },
              stroke: {
                dashArray: 4
              },
              labels: ['Median Ratio'],
            },


          };





export default function Test() {
    return (
        <div>

    {/* <Chart
        options={options1}
        type="radialBar"
        width="500"
    /> */}

        <div id="chart">
        <Chart options={config.options} series={config.series} type="radialBar" />
        </div>



        </div>
    )
}
